    text: "export function MonthCaption(props: MonthCaptionProps) {\n  const {\n    classNames,\n    captionLayout,\n    dropdownNavigation,\n    formatters: { formatCaption },\n    locale,\n    styles\n  } = useDayPicker();\n\n  return (\n    <div\n      id={props.id}\n      className={classNames.month_caption}\n      style={styles?.month_caption}\n    >\n      {captionLayout === 'dropdown' || captionLayout === 'dropdown-buttons' ? (\n        <DropdownNav\n          month={props.month}\n          index={props.index}\n          showMonths\n          showYears\n        />\n      ) : dropdownNavigation ? (\n        <DropdownNav\n          month={props.month}\n          index={props.index}\n          showMonths={\n            dropdownNavigation === true || dropdownNavigation === 'month'\n          }\n          showYears={\n            dropdownNavigation === true || dropdownNavigation === 'year'\n          }\n        />\n      ) : (\n        <span className={classNames.caption_label}>\n          {formatCaption(props.month.date, { locale })}\n        </span>\n      )}\n    </div>\n  );\n}",
