    slug: "addtorange",
    startLine: 13,
    endLine: 49,
    text: "export function addToRange(\n  date: Date,\n  range?: DateRange\n): DateRange | undefined {\n  const { from, to } = range || {};\n  if (from && to) {\n    if (isSameDay(to, date) && isSameDay(from, date)) {\n      return undefined;\n    }\n    if (isSameDay(to, date)) {\n      return { from: to, to: undefined };\n    }\n    if (isSameDay(from, date)) {\n      return undefined;\n    }\n    if (isAfter(from, date)) {\n      return { from: date, to };\n    }\n    return { from, to: date };\n  }\n  if (to) {\n    if (isAfter(date, to)) {\n      return { from: to, to: date };\n    }\n    return { from: date, to };\n  }\n  if (from) {\n    if (isBefore(date, from)) {\n      return { from: date, to: from };\n    }\n    if (isSameDay(date, from)) {\n      return { from: undefined, to: undefined };\n    }\n    return { from, to: date };\n  }\n  return { from: date, to: undefined };\n}",
