    slug: "isdateinrange",
    startLine: 7,
    endLine: 26,
    text: "export function isDateInRange(date: Date, range: DateRange): boolean {\n  let { from, to } = range;\n  if (from && to) {\n    const isRangeInverted = differenceInCalendarDays(to, from) < 0;\n    if (isRangeInverted) {\n      [from, to] = [to, from];\n    }\n    const isInRange =\n      differenceInCalendarDays(date, from) >= 0 &&\n      differenceInCalendarDays(to, date) >= 0;\n    return isInRange;\n  }\n  if (to) {\n    return isSameDay(to, date);\n  }\n  if (from) {\n    return isSameDay(from, date);\n  }\n  return false;\n}",
